import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { CssBaseline, Box } from '@mui/material';
import Sidebar from './Sidebar';
import Header from './Header'; // Assuming you have this
import TransferCertificate from './Forms/TransferCertificate';
import Paragraph1 from './Forms/Paragraph1';
import Paragraph2 from './Forms/Paragraph2';
import Paragraph3 from './Forms/Paragraph3';
import Paragraph4 from './Forms/Paragraph4';
import Paragraph5 from './Forms/Paragraph5';
import Paragraph6 from './Forms/Paragraph6';
import Paragraph7 from './Forms/Paragraph7';

const App = ({ user = true }) => {
  return (
    <Router>
      {user && (
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
          <CssBaseline />
          <Header />
          <Box sx={{ display: 'flex', flexGrow: 1, marginTop: '64px' }}>
            <Sidebar />
            <Box
              component="main"
              sx={{
                flexGrow: 1,
                padding: 3,
                marginLeft: { sm: '240px' }, // Optional, based on Sidebar width
                overflowY: 'auto',
                height: 'calc(100vh - 64px)', // Adjust if Header height differs
                backgroundColor: '#f5f5f5',
                borderRadius: 2,
              }}
            >
              <Routes>
                <Route path="/" element={<Navigate to="/transfer-certificate" />} />
                <Route path="/transfer-certificate" element={<TransferCertificate />} />
                <Route path="/paragraph1" element={<Paragraph1 />} />
                <Route path="/paragraph2" element={<Paragraph2 />} />
                <Route path="/paragraph3" element={<Paragraph3 />} />
                <Route path="/paragraph4" element={<Paragraph4 />} />
                <Route path="/paragraph5" element={<Paragraph5 />} />
                <Route path="/paragraph6" element={<Paragraph6 />} />
                <Route path="/paragraph7" element={<Paragraph7 />} />
                <Route path="*" element={<h2>Page Not Found</h2>} />
              </Routes>
            </Box>
          </Box>
        </Box>
      )}
    </Router>
  );
};

export default App;
